import React from 'react';

type Process = {
  id: number
  name: string
}

const MC: Process[] = [
  {
    id: 1,
    name: "MC1-40"
  }, {
    id: 2,
    name: "MC1-50"
  }, {
    id: 3,
    name: "VM53R"
  }, {
    id: 4,
    name: "VM73"
  }
]

const Process: React.FC = () => {
  return (
    <div className="Process">
      <form>
        <select>
          { MC.map((item: Process) => (
            <option key={ item.id }>{ item.name }</option>
          )) }
        </select>
      </form>
    </div>
  )
}


export default Process;
